package uz.gita.newsapp_practice.presenter.screens.detail.sliderimport uz.gita.newsapp_practice.utils.navigation.AppNavigatorimport javax.inject.Injectinterface SliderDirection {    suspend fun backToMain()}class SliderDirectionImpl @Inject constructor(    private val appNavigator: AppNavigator,) : SliderDirection {    override suspend fun backToMain() {        appNavigator.back()    }}